description:
The Firing Line 2013

Sociopolitical Documentary hosted by Yalda Hakim, published by BBC broadcasted as part of BBC The Firing Line series in 2013 - English narration


Information
------------------------------

Some of the most dramatic video of the year has been brought to us by freelance journalists covering hostile environments around the world. Firing Line pays tribute to an international field of nominees in the 2011 Rory Peck Awards.

